// PERSON ICONS SVG LIBRARY TO USE AS APPOSED TO INSTALING THE REACT ICONS
const layout = ({ name, size, className, onClick }) => {
	// DETERMINE ICON SIZE
	size = getPxSize(size)

	// SET COLOR FOR ICON TO NEUTRAL GRAY
	if (!className) {
		className = 'fill-current'
	}

	return (
		<svg
			width={size}
			height={size}
			viewBox='0 0 40 40'
			fill='none'
			xmlns='http://www.w3.org/2000/svg'
			onClick={onClick}
			title={name}
			name={name}
		>
			{getPath(name, className)}
		</svg>
	)
}

// GET ICON PIXEL SIZE
export const getPxSize = (size) => {
	switch (size) {
		case 'sm':
			return 20
		case 'md':
			return 40
		case 'lg':
			return 75
		case 'xl':
			return 125
		default:
			if (isNaN(size)) {
				return 40
			} else {
				return size
			}
	}
}

